--Xóa user 

CREATE OR REPLACE PROCEDURE drop_users_with(substring_pattern IN VARCHAR2) IS
    STRSQL VARCHAR2(2000);
BEGIN

    -- Declare cursor to select users matching the pattern
    FOR user_rec IN (SELECT username FROM all_users WHERE username LIKE substring_pattern || '%') LOOP
        EXECUTE IMMEDIATE 'DROP USER ' || user_rec.username || ' CASCADE';
        DBMS_OUTPUT.PUT_LINE('Dropped user: ' || user_rec.username);
    END LOOP;

END drop_users_with;
/

--Xoá tất cả user trong bảng nhân sự
exec drop_users_with('NS'); 
--Xoá tất cả user trong bảng sinh viên
exec drop_users_with('SV');

--Xóa role
CREATE OR REPLACE PROCEDURE drop_role_if_exists (
    role_name IN VARCHAR2
)
IS
BEGIN
    EXECUTE IMMEDIATE 'DROP ROLE ' || role_name;
    DBMS_OUTPUT.PUT_LINE('DROPPED ROLE: ' || role_name);
EXCEPTION
    WHEN OTHERS THEN
        IF SQLCODE != -1919 THEN -- Role not exists error code
            RAISE;
        END IF;
END drop_role_if_exists;
/

