--PROCEDURE tao user theo nhanvien
-- Tai khoan se gom CHUCVU + MANHV, VD GD1, TPKT2, NVKTH48
CREATE OR REPLACE PROCEDURE USP_CREATE_USER_NHSU
AS 
 CURSOR CUR IS 
 SELECT MaNV, DT, VAITRO
 FROM NHANSU 
 WHERE UPPER(MaNV) NOT IN (SELECT UPPER(USERNAME) FROM ALL_USERS); 
 STRSQL VARCHAR2(2000); 
 USR NHANSU.MANV%TYPE; 
 VAITRO NHANSU.VAITRO%TYPE;
 DT NHANSU.DT%TYPE;
BEGIN 
 OPEN CUR; 
 LOOP 
 FETCH CUR INTO USR, DT, VAITRO ; 
 EXIT WHEN CUR%NOTFOUND; 
  
 STRSQL := 'CREATE USER ' || to_char(USR) || ' IDENTIFIED BY ' || to_char(DT); 
 EXECUTE IMMEDIATE STRSQL; 
 STRSQL := 'GRANT CREATE SESSION TO ' || to_char(USR); 
 EXECUTE IMMEDIATE STRSQL; 
 IF VAITRO = 'Nhân viên cơ bản' THEN
    STRSQL := 'GRANT NHANVIENCOBAN TO ' || to_char(USR); 
 ELSIF VAITRO = 'Giảng viên' THEN
    STRSQL := 'GRANT GIANGVIEN TO ' || to_char(USR); 
 ELSIF VAITRO = 'Trưởng đơn vị' THEN
    STRSQL := 'GRANT TRUONGDONVI TO ' || to_char(USR); 
 ELSIF VAITRO = 'Trưởng khoa' THEN
    STRSQL := 'GRANT TRUONGKHOA TO ' || to_char(USR); 
 ELSIF VAITRO = 'Giáo vụ' THEN
    STRSQL := 'GRANT GIAOVU TO ' || to_char(USR); 
 END IF;
 EXECUTE IMMEDIATE STRSQL; 
 DBMS_OUTPUT.PUT_LINE('Created user: ' || to_char(USR));
 END LOOP; 
 CLOSE CUR; 
END; 
/

EXECUTE USP_CREATE_USER_NHSU;
