--PROCEDURE tao user theo sinhvien
-- Tai khoan se gom ID: MASV pass: SDT
CREATE OR REPLACE PROCEDURE USP_CREATE_USER_SINHVIEN
AS 
 CURSOR CUR IS SELECT MaSV, DT 
  FROM SINHVIEN 
  WHERE UPPER(MaSV) NOT IN (SELECT UPPER(USERNAME) 
     FROM ALL_USERS); 
 STRSQL VARCHAR2(2000); -- Changed VARCHAR to VARCHAR2
 USRSV SINHVIEN.MASV%TYPE; 
 DT SINHVIEN.DT%TYPE;
BEGIN 
 OPEN CUR; 
 LOOP 
 FETCH CUR INTO USRSV, DT; 
 EXIT WHEN CUR%NOTFOUND; 
  
 STRSQL := 'CREATE USER ' || to_char(USRSV) || ' IDENTIFIED BY ' || to_char(DT); 
 EXECUTE IMMEDIATE STRSQL; 
 STRSQL := 'GRANT CREATE SESSION, SINHVIEN TO ' || to_char(USRSV); 
 EXECUTE IMMEDIATE STRSQL; 
 DBMS_OUTPUT.PUT_LINE('Created user: ' || to_char(USRSV)); -- Added missing closing parenthesis
 END LOOP; 
 CLOSE CUR; 
END; 
/

EXECUTE USP_CREATE_USER_SINHVIEN;
